INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12767,'MEZ77480','One 12 Collective Mr Freeze Deluxe Edition~One 12 Collective 急冻先生~','1.5',3,13,'11',0,1,118.90,0.00,0.00,94.00,452.82,'','',1,'SUP-US-DC','04/01/2020','US$',65.00,'6',0,0,'0','','0',0.00,0,600.00,600.00,200.00,'','','03/05/2020',0,'03/30/2020',0.00,'','','','','','2020-03-31 14:58:47','',0,'CN-WH','undefined','Mr. Freeze emerges from his frigid laboratory to join the One:12 Collective.\n\nOutfitted in an armored cryo-suit, this complex technology is not only keeping him alive, but also augmenting his strength and durability to superhuman levels. The power pack attached to the back of the cryo-suit features light-up ice crystals. \n\nEquipped with weaponry capable of causing more than just frostbite, Mr. Freeze comes complete with a freeze ray cannon with light-up function, freeze ray handgun, an ice blast FX that fits over the chests of some other One:12 figures, and a freeze FX that fits over the heads of some other One:12 figures.\n\nMr. Freeze is contained neatly in a cryo-chamber shaped tin, with a frosted window revealing the inside.\n\nDr. Victor Fries, also known as Mr. Freeze, was a cryogenics expert in Gotham City who was caught in a laboratory mishap in an attempt to cure his terminally ill wife. The accident drastically lowered his body temperature, forcing him to wear a cryogenic suit in order to survive. Utilizing this advanced technology, Mr. Freeze became a criminal with a taste for diamonds and revenge.\n\n\n\nTHE ONE:12 COLLECTIVE MR. FREEZE FIGURE FEATURES:\n\nOne:12 Collective body with over 30 points of articulation\nTwo (2) head portraits\nHand painted authentic detailing\nApproximately 17cm tall\nEight (8) interchangeable hands\nOne (1) pair of fists (L & R)\nOne (1) pointing hand (L)\nOne (1) posing hand (R)\nOne (1) pair of holding hands (L & R)\nOne (1) pair of grabbing/gun supporting hands (L & R)  \n\nCOSTUME:\n\nClear helmet (removable)\nArmored Cryo-tech suit with light-up function\nBelt with removable holster\nCryo-tech gloves\nCryo-tech boots \n\n\nACCESSORIES:\n\nOne (1) freeze ray cannon with light-up function\nOne (1) freeze ray handgun\nOne (1) ice blast FX\nOne (1) freeze FX\nOne (1) One:12 Collective display base with logo\nOne (1) One:12 Collective adjustable display post\n\nEach One:12 Collective Mr. Freeze figure is packaged in a collector friendly cryo-chamber tin, designed with collectors in mind. \n~Mr. Freeze emerges from his frigid laboratory to join the One:12 Collective.\n\nOutfitted in an armored cryo-suit, this complex technology is not only keeping him alive, but also augmenting his strength and durability to superhuman levels. The power pack attached to the back of the cryo-suit features light-up ice crystals. \n\nEquipped with weaponry capable of causing more than just frostbite, Mr. Freeze comes complete with a freeze ray cannon with light-up function, freeze ray handgun, an ice blast FX that fits over the chests of some other One:12 figures, and a freeze FX that fits over the heads of some other One:12 figures.\n\nMr. Freeze is contained neatly in a cryo-chamber shaped tin, with a frosted window revealing the inside.\n\nDr. Victor Fries, also known as Mr. Freeze, was a cryogenics expert in Gotham City who was caught in a laboratory mishap in an attempt to cure his terminally ill wife. The accident drastically lowered his body temperature, forcing him to wear a cryogenic suit in order to survive. Utilizing this advanced technology, Mr. Freeze became a criminal with a taste for diamonds and revenge.\n\n\n\nTHE ONE:12 COLLECTIVE MR. FREEZE FIGURE FEATURES:\n\nOne:12 Collective body with over 30 points of articulation\nTwo (2) head portraits\nHand painted authentic detailing\nApproximately 17cm tall\nEight (8) interchangeable hands\nOne (1) pair of fists (L & R)\nOne (1) pointing hand (L)\nOne (1) posing hand (R)\nOne (1) pair of holding hands (L & R)\nOne (1) pair of grabbing/gun supporting hands (L & R)  \n\nCOSTUME:\n\nClear helmet (removable)\nArmored Cryo-tech suit with light-up function\nBelt with removable holster\nCryo-tech gloves\nCryo-tech boots \n\n\nACCESSORIES:\n\nOne (1) freeze ray cannon with light-up function\nOne (1) freeze ray handgun\nOne (1) ice blast FX\nOne (1) freeze FX\nOne (1) One:12 Collective display base with logo\nOne (1) One:12 Collective adjustable display post\n\nEach One:12 Collective Mr. Freeze figure is packaged in a collector friendly cryo-chamber tin, designed with collectors in mind. \n~','~~','~~',0,'Sep 2020',0,'','RMB','',0,0,1,2,'0',0,NULL,0);
