INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12287,'MEZ76920','One:12 Cyclops~One 12:雷蛇眼~','1.5',3,7,'11',0,1,430.00,0.00,0.00,700.00,355.58,'','',1,'SUP-US-MEZ','09/10/2018','US$',55.00,'6',0,0,'0','','0',0.00,0,480.00,480.00,100.00,'','','08/24/2018',0,'09/06/2018',0.00,'','','','','','2018-12-19 13:58:04','',0,'CN-WH','undefined','The One:12 Collective Cyclops features a light-up optic power function that illuminates his signature ruby-quartz visor, containing the uncontrollable energy blasts from his eyes. The born leader and gifted hero is outfitted in an aramid fiber x-suit with a utility belt and harness, and a removable leather-like jacket. Cyclops comes complete with a range of visor effects that light up when affixed to either head portrait, reflecting his devastating mutant abilities. \n\nScott Summer\'s mutant power first erupted from his eyes as an uncontrollable blast of optic force. Rescued by Professor Xavier, he was recruited as the first member of the X-Men - a team of young mutants who trained to use their powers for the good of mutants, humans, and equality.~The One:12 Collective Cyclops features a light-up optic power function that illuminates his signature ruby-quartz visor, containing the uncontrollable energy blasts from his eyes. The born leader and gifted hero is outfitted in an aramid fiber x-suit with a utility belt and harness, and a removable leather-like jacket. Cyclops comes complete with a range of visor effects that light up when affixed to either head portrait, reflecting his devastating mutant abilities. \n\nScott Summer\'s mutant power first erupted from his eyes as an uncontrollable blast of optic force. Rescued by Professor Xavier, he was recruited as the first member of the X-Men - a team of young mutants who trained to use their powers for the good of mutants, humans, and equality.\n~','THE ONE:12 COLLECTIVE CYCLOPS FIGURE FEATURES:\n\n·      One:12 Collective body with over 28 points of articulation\n·      Two (2) head portraits\n·      Hand painted authentic detailing\n·      Approximately 17cm tall\n·      Six (6) interchangeable hands\no   One (1) pair of fists (L&R)\no   One (1) pair of posing hands (L&R)\no   One (1) combat hand (R)\no   One (1) visor activation hand (L)\n \nCOSTUME:\n·      X-Men issued mission suit\n·      Utility belt with harness\n·      Combat gloves\n·      Leather-like biker jacket with functional zipper\n·      Tactical boots\n \n \nACCESSORIES:\n·      Four (4) visors\no   Standard visor\no   Smoking SFX visor\no   Optic blast SFX visor\no   Mega optic blast SFX visor\n·      One (1) One:12 Collective display base with logo\n·      One (1) One:12 Collective adjustable display post\n \n \nEach One:12 Collective Cyclops figure is packaged in a collector friendly box, designed with collectors in mind. ~THE ONE:12 COLLECTIVE DAREDEVIL FIGURE FEATURES:\n\n·      One:12 Collective body with over 28 points of articulation\n·      Two (2) head portraits\n·      Hand painted authentic detailing\n·      Approximately 17cm tall\n·      Six (6) interchangeable hands\no   One (1) pair of fists (L&R)\no   One (1) pair of Billy Club holding hands (L&R)\no   One (1) pair of posing hands (L&R)\n \nCOSTUME:\n·      Fitted suit with body armor detail\n·      Combat gloves\n·      Thigh holster for Billy Clubs\n·      Mid-calf work boots~','~~',0,'Feb 2019',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
