INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12801,'MEZ77421','One 12 Collective Wonder Woman~One 12 Collective 神奇女侠~','1.5',3,19,'11',0,1,399.00,445.00,0.00,600.00,322.62,'','',1,'SUP-US-MEZ','06/22/2020','US$',45.00,'6',0,0,'0','','0',0.00,0,0.00,0.00,0.00,'','','05/28/2020',0,'06/19/2020',0.00,'','','','','','2020-05-28 21:22:03','',0,'CN-WH','undefined','The One:12 Collective Wonder Woman is combat-ready, outfitted in a Themysciran battle suit with removable neck and shoulder armor, worn only by the most elite Amazonian warriors. The fearless demigoddess wears a cape with an integrated posing wire that attaches via a clasp at the neck. Man-made weaponry doesn’t stand a chance – bullets ricochet right off her wrist bracelets with the included effects that attach via magnet. Wonder Woman is well-equipped to fight for justice, complete with the Sword of Athena, Lasso of Truth which can be held on her belt, a battle axe, a spear, and a shield.\n\nWise as Athena, stronger than Hercules, beautiful as Aphrodite, and swifter than Hermes, Princess Diana of Themyscira has made it her duty to lead by example and fight for peace. Wonder Woman stands as a symbol of truth, justice, and equality to people everywhere.\n\nTHE ONE:12 COLLECTIVE WONDER WOMAN FIGURE FEATURES:\n\n<br>·       One:12 Collective body with over 30 points of articulation\n<br>·       Two (2) head portraits\n<br>·       Hand painted authentic detailing\n<br>·       Approximately 17cm tall\n<br>·       Eight (8) interchangeable hands including \n<br>.   One (1) pair of fists (L & R)\n<br>.   One (1) pair of lasso holding hands (L & R)\n<br>.   One (1) pair of sword holding hands (L & R)\n<br>.   One (1) pair of posing hands (L&R)\n \n<br>COSTUME:\n\n<br>·       Royal Tiara\n<br>·       Fortified neck and shoulder armor (removable)\n<br>·       Reinforced torso armor\n<br>·       Wrist bracelets\n<br>·       Cape (removable, with integrated posing wire)\n<br>·       Belt with ‘W’ insignia\n<br>·       Skirt\n<br>·       Shin armor\n<br>·       Combat boots\n \n<br>ACCESSORIES:\n\n<br>·       One (1) Lasso of Truth (poseable)\n<br>·       One (1) coiled Lasso of Truth (attaches to belt)\n<br>·       One (1) Sword of Athena\n<br>·       One (1) battle axe\n<br>·       One (1) spear\n<br>·       One (1) shield\n<br>·       Three (3) Ricocheting bullet FX (attaches magnetically to wrist bracelets)\n<br>·       One (1) One:12 Collective display base with logo\n<br>·       One (1) One:12 Collective adjustable display post~The One:12 Collective Wonder Woman is combat-ready, outfitted in a Themysciran battle suit with removable neck and shoulder armor, worn only by the most elite Amazonian warriors. The fearless demigoddess wears a cape with an integrated posing wire that attaches via a clasp at the neck. Man-made weaponry doesn’t stand a chance – bullets ricochet right off her wrist bracelets with the included effects that attach via magnet. Wonder Woman is well-equipped to fight for justice, complete with the Sword of Athena, Lasso of Truth which can be held on her belt, a battle axe, a spear, and a shield.\n\nWise as Athena, stronger than Hercules, beautiful as Aphrodite, and swifter than Hermes, Princess Diana of Themyscira has made it her duty to lead by example and fight for peace. Wonder Woman stands as a symbol of truth, justice, and equality to people everywhere.\n\nTHE ONE:12 COLLECTIVE WONDER WOMAN FIGURE FEATURES:\n\n<br>·       One:12 Collective body with over 30 points of articulation\n<br>·       Two (2) head portraits\n<br>·       Hand painted authentic detailing\n<br>·       Approximately 17cm tall\n<br>·       Eight (8) interchangeable hands including \n<br>.   One (1) pair of fists (L & R)\n<br>.   One (1) pair of lasso holding hands (L & R)\n<br>.   One (1) pair of sword holding hands (L & R)\n<br>.   One (1) pair of posing hands (L&R)\n \n<br>COSTUME:\n\n<br>·       Royal Tiara\n<br>·       Fortified neck and shoulder armor (removable)\n<br>·       Reinforced torso armor\n<br>·       Wrist bracelets\n<br>·       Cape (removable, with integrated posing wire)\n<br>·       Belt with ‘W’ insignia\n<br>·       Skirt\n<br>·       Shin armor\n<br>·       Combat boots\n \n<br>ACCESSORIES:\n\n<br>·       One (1) Lasso of Truth (poseable)\n<br>·       One (1) coiled Lasso of Truth (attaches to belt)\n<br>·       One (1) Sword of Athena\n<br>·       One (1) battle axe\n<br>·       One (1) spear\n<br>·       One (1) shield\n<br>·       Three (3) Ricocheting bullet FX (attaches magnetically to wrist bracelets)\n<br>·       One (1) One:12 Collective display base with logo\n<br>·       One (1) One:12 Collective adjustable display post~','~~','~~',0,'Dec 2020',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
