 Mezco\'s One:12 Batman series continues with this PREVIEWS Exclusive Batman: Supreme Knight! The Supreme Knight depicts an older Bruce Wayne who has learned his way and honed his skills. Supreme Knight\'s Bat Suit provides additional armored protection enhancements to compensate for the wear and tear that his years of crime fighting have taken on him. A magnet in his collar allows him to switch between two leather-like capes: one with an integrated posing wire and one that drapes freely, and he employs an upgraded arsenal including a dual-blade karambit that folds, a multifunctional, non-lethal \"\"Equalizer\"\" cannon, grappling gun, and more! Each One:12 Collective Batman: Supreme Knight figure is packaged in a collector friendly box, designed with collectors in mind. ~\"','~~',0,'May 2020',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
