 the sleeper hit THE CONJURING. Then she returned in ANNABELLE, a film dedicated to her origin story. This summer she returns to theaters in ANNABELLE: CREATION to terrorize a group of orphans.\n\nThe Living Dead Dolls Presents: Annabelle doll stands ten inches tall and features five points of articulation.  With film accurate clothing and hair she appears to have stepped directly off the theatre screen. She comes complete in a collector friendly window box so that she can watch you, silently waiting for the right time to make her move.\n~','~~','~~',0,'17-Oct',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
