INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12173,'IA44110','Legacy of Cybertron Optimus Prime~Legacy 擎天柱雕像~','6',8,1,'204',0,1,1488.00,1736.00,0.00,500.00,1000.00,'','',1,'SUP-CN-NC','3/16/2018','RMB',1000.00,'1',0,0,'0','','0',0.00,0,2480.00,2480.00,600.00,'a','','2/6/2018',0,'3/8/2018',0.00,'','','11/18/2007','','','2018-12-20 13:58:52','http://iscn.toyntoys.asia/inventory/ItemImages/IA44110_face.jpg',0,'CN-WH','undefined','Optimus Prime,, is the leader of the Autobots. Long ago, he was the novice to the Great Sentinel Prime and the humble leader of Cybertron\'s science division, which studied the AllSpark and were protected by Lord High Protector Megatron\'s military. When Megatron was corrupted by the Fallen, Optimus discovered that he was the last of the Dynasty of Primes hidden away when the Fallen destroyed their lineage. In response to Megatron\'s attempts to seize the AllSpark and conquer other worlds, Optimus assumed his proper title and rallied the Autobots to stand against the Decepticons. Before the disappearance of Sentinel, Optimus is handed the leadership of the Autobots.\n\n<BR>As obsessively as Megatron strives to achieve his objective, Optimus is equally as dedicated to stopping him even at the cost of his life, his world and - if necessary - his own people. It was on his order that the AllSpark was jettisoned into space, dooming Cybertron to a slow death and his people to a nomadic life. The sacrifices he has made weigh heavily on his spark, but they must be done for there is no other choice. He knows the ambitions that lurk in his brother\'s spark and they must never see the light of day. Lives must be kept free from the threat of Megatron\'s tyranny, no matter the cost. This obsession with the defeat of Megatron has robbed Optimus of some of his early idealism. This has created a certain ruthlessness beneath his otherwise honest and caring personality. Prime is not one for second chances and is willing to consider any action that might lead to victory, short of directly sacrificing those he cares about.~Optimus Prime,, is the leader of the Autobots. Long ago, he was the novice to the Great Sentinel Prime and the humble leader of Cybertron\'s science division, which studied the AllSpark and were protected by Lord High Protector Megatron\'s military. When Megatron was corrupted by the Fallen, Optimus discovered that he was the last of the Dynasty of Primes hidden away when the Fallen destroyed their lineage. In response to Megatron\'s attempts to seize the AllSpark and conquer other worlds, Optimus assumed his proper title and rallied the Autobots to stand against the Decepticons. Before the disappearance of Sentinel, Optimus is handed the leadership of the Autobots.\n\n<BR>As obsessively as Megatron strives to achieve his objective, Optimus is equally as dedicated to stopping him even at the cost of his life, his world and - if necessary - his own people. It was on his order that the AllSpark was jettisoned into space, dooming Cybertron to a slow death and his people to a nomadic life. The sacrifices he has made weigh heavily on his spark, but they must be done for there is no other choice. He knows the ambitions that lurk in his brother\'s spark and they must never see the light of day. Lives must be kept free from the threat of Megatron\'s tyranny, no matter the cost. This obsession with the defeat of Megatron has robbed Optimus of some of his early idealism. This has created a certain ruthlessness beneath his otherwise honest and caring personality. Prime is not one for second chances and is willing to consider any action that might lead to victory, short of directly sacrificing those he cares about.~','<ul>\n<li>L.E.D. Lightings: Eyes & Roller</li>\n<li>Soft Touch On/Off </li>\n<li> Material: PU, PP, 3D Printed Parts</li>\n\n<li> </li>\n<li>In the Package </li>\n<li>1 Main Body\n<li>1 Base </li>\n\n<BR>\n<li>Measurement:30 (W) x 37cm (W) x 37cm(H)</li>\n<li>Weight: 16kg</li>\n<li>Scale : Non scale, refer to measurement</li>\n<li>Edition Size 500 worldwide </li>\n<li>Actual product Color may vary from pictures on website</li>\n<li>Note: Suitable for Ages 14 and Above  </li>\n</ul>~材料: PU, 树脂，3D打印件\n\n包装内含\n1）人物\n2）底座\n\n尺寸: 30cm (长) x 37cm (宽) x 37cm(高)\n重量: 7kg\n比例 : 以尺寸为准\n限量：全球500台~','~~',0,'18-Jun',0,'','RMB','',0,0,2,10,'1',7,NULL,0);
