INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12210,'IA43118','G1 Starscream Exclusive Statue~SHCC G1 红蜘蛛限量版 雕像~','6',8,1,'204',0,1,0.00,0.00,0.00,0.00,2500.00,'','',1,'SUP-CN-NC','6/18/2018','RMB',2500.00,'1',0,0,'0','','0',0.00,0,7500.00,7500.00,2000.00,'','','6/18/2018',0,'6/18/2018',0.00,'','','11/18/2007','','','2018-12-19 13:58:04','http://iscn.toyntoys.asia/inventory/ItemImages/IA43118_face.jpg',0,'CN-WH','undefined','Optimus Prime,, is the leader of the Autobots. Long ago, he was the novice to the Great Sentinel Prime and the humble leader of Cybertron\'s science division, which studied the AllSpark and were protected by Lord High Protector Megatron\'s military. When Megatron was corrupted by the Fallen, Optimus discovered that he was the last of the Dynasty of Primes hidden away when the Fallen destroyed their lineage. In response to Megatron\'s attempts to seize the AllSpark and conquer other worlds, Optimus assumed his proper title and rallied the Autobots to stand against the Decepticons. Before the disappearance of Sentinel, Optimus is handed the leadership of the Autobots.\n\n<BR>As obsessively as Megatron strives to achieve his objective, Optimus is equally as dedicated to stopping him even at the cost of his life, his world and - if necessary - his own people. It was on his order that the AllSpark was jettisoned into space, dooming Cybertron to a slow death and his people to a nomadic life. The sacrifices he has made weigh heavily on his spark, but they must be done for there is no other choice. He knows the ambitions that lurk in his brother\'s spark and they must never see the light of day. Lives must be kept free from the threat of Megatron\'s tyranny, no matter the cost. This obsession with the defeat of Megatron has robbed Optimus of some of his early idealism. This has created a certain ruthlessness beneath his otherwise honest and caring personality. Prime is not one for second chances and is willing to consider any action that might lead to victory, short of directly sacrificing those he cares about.~~','<ul>\n<li>L.E.D. Lightings: Eyes & Roller</li>\n<li>Soft Touch On/Off </li>\n<li> Material: PU, PP, 3D Printed Parts</li>\n\n<li> </li>\n<li>In the Package </li>\n<li>1 Head\n2 Rifles \n1 Axe\n1 Roller Vehicle\n1 Maintenance Vehicle Unit\n1 Base with Opened Cargo Container</li>\n\n<BR>\n<li>Measurement: 88cm (W) x 50cm (W) x 62cm(H)</li>\n<li>Weight: 13kg</li>\n<li>Scale : Non scale, refer to measurement</li>\n<li>Edition Size 500 worldwide </li>\n<li>Actual product Color may vary from pictures on website</li>\n<li>Note: Suitable for Ages 14 and Above  </li>\n</ul>~~','~~',0,'Nov 2018',0,'','RMB','',0,0,5,2,'1',7,NULL,0);
