INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12277,'GG80780','Han Solo in Carbonite~汉索罗碳棺~','3',8,43,'208',0,1,790.00,860.00,0.00,300.00,568.86,'','',1,'SUP-US-GG','09/14/2018','US$',87.99,'6',0,0,'0','','0',0.00,0,1099.00,1099.00,200.00,'','','08/15/2018',0,'09/07/2018',0.00,'','','','','','2018-12-19 13:58:04','',0,'CN-WH','undefined','Carbon-freezing is an industrial process that encases highly pressurized gasses inside of solidified carbonite.  In Cloud City Darth Vader sets a trap for young Luke Skywalker to be frozen and tests the process on his prisoner Han Solo.  The smuggler turned hero survived the freezing process, in perfect hibernation, and Vader hands captain Solo over to the bounty hunter Boba Fett to take back to the gangster Jabba The Hutt. \nHan Solo In Carbonite is the seventh statue in Bounty Hunter 1:8th Collector’s Gallery line celebrating over 40 years of the Star Wars universe. This accurate sculpture comes from scans of the actual carbonite block prop for the ultimate attention to detail.  The Han Solo’s frozen, pained expression is perfectly captured in this carbonite block, with a base that matches the alcove where the frozen Han Solo hung as a prized possession in the Mighty Jabba’s palace.  Bring Han home and he can be a prize in your collection too. Pre-Order now to complete your 1:8th scale bounty hunter collection, have as a stand-alone piece or make sure your Boba Fett collector’s gallery statue is not lonely. Each limited edition, hand-painted piece is cast in high quality polyresin with crisp details. This statue comes individually numbered with a matching Certificate of Authenticity.~Carbon-freezing is an industrial process that encases highly pressurized gasses inside of solidified carbonite.  In Cloud City Darth Vader sets a trap for young Luke Skywalker to be frozen and tests the process on his prisoner Han Solo.  The smuggler turned hero survived the freezing process, in perfect hibernation, and Vader hands captain Solo over to the bounty hunter Boba Fett to take back to the gangster Jabba The Hutt. \nHan Solo In Carbonite is the seventh statue in Bounty Hunter 1:8th Collector’s Gallery line celebrating over 40 years of the Star Wars universe. This accurate sculpture comes from scans of the actual carbonite block prop for the ultimate attention to detail.  The Han Solo’s frozen, pained expression is perfectly captured in this carbonite block, with a base that matches the alcove where the frozen Han Solo hung as a prized possession in the Mighty Jabba’s palace.  Bring Han home and he can be a prize in your collection too. Pre-Order now to complete your 1:8th scale bounty hunter collection, have as a stand-alone piece or make sure your Boba Fett collector’s gallery statue is not lonely. Each limited edition, hand-painted piece is cast in high quality polyresin with crisp details. This statue comes individually numbered with a matching Certificate of Authenticity.~','About 25-30cm tall\nScale: 1/8~大约 25-30cm 高\n比例: 1/8~','~~',0,'Mar 2019',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
