uring the fearsome expressions of the dream demon, including one with a removable faceplate that reveals a skull sculpt - from the iconic scene where Freddy & Tina have a fatal encounter. Freddy is outfitted in his infamous striped sweater and comes complete with his signature clawed gloves and a trash can lid, straight from Tina’s nightmare.\nIn Wes Craven\'s classic slasher film, ‘A Nightmare on Elm Street’, several teenagers fall victim to Freddy Krueger as he preys on them in their dreams. Dark secrets start to unravel as the teens suspect their parents may be the key to solving the puzzle before it’s too late.~','·      One:12 Collective body with over 30 points of articulation\n·      Four (4) head portraits\n·      Hand painted authentic detailing\n·      Approximately 16cm tall\n·     Six (6) interchangeable hands including \no   One (1) claw hand (R)\no   One (1) pointing claw hand (R)\no   One (1) posing hand (L)\no   One (1) grappling hand (L)\no   One (1) severed finger hand (L)\no   One (1) fist (L) \n                                                                                                                                                                                                                      COSTUME:\n·      Fedora\n·      Striped sweater\n·      Slacks\n·      Work boots\n \n ACCESSORIES:\n·      One (1) trash can lid\n·      One (1) One:12 Collective display base with logo\n·      One (1) One:12 Collective adjustable display post\n~·      One:12 Collective body with over 30 points of articulation\n·      Four (4) head portraits\n·      Hand painted authentic detailing\n·      Approximately 16cm tall\n·     Six (6) interchangeable hands including \no   One (1) claw hand (R)\no   One (1) pointing claw hand (R)\no   One (1) posing hand (L)\no   One (1) grappling hand (L)\no   One (1) severed finger hand (L)\no   One (1) fist (L) \n                                                                                                         