amous homicidal doll containing the soul of a serial killer.\n\nApproximately 14” tall when “popped”, the Burst-A-Box is a finely detailed tin music box that encases a detailed sculpt and clothed spring character. \n\nDesigned after his appearance in the film, Chucky features a scarred head sculpt and sports his signature ‘Good Guys’ overalls with stripped shirt.\n\nBurst-A-Box: Scarred Chucky comes packaged popped-out of his tin and perfect for display in a collector-friendly window box.~','14 inches tall when popped~14寸高~','~~',0,'Dec 2018',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
INSERT INTO `` (`ID`,`ItemCode`,`Description`,`ItemWeight`,`Department`,`Category`,`Brand`,`InActive`,`WebItem`,`PriceA`,`PriceB`,`PriceC`,`WDeposit`,`ItemCost`,`Arrival_Date`,`Date_Arrived`,`SupplierActive_1`,`Supplier1`,`DateLine1`,`Currency1`,`OfferedCost1`,`PcsPerCarton`,`POQty1`,`SupplierActive_2`,`Supplier2`,`DateLine2`,`Currency2`,`OfferedCost2`,`POQty2`,`RetailPrice`,`PreorderPrice`,`Deposit`,`MemberA`,`MemberB`,`SalesStart_Date`,`sale_type`,`SalesEnd_Date`,`SPOfferPrice`,`SP_StartDate`,`SP_EndDate`,`Date_Created`,`Last_Received`,`Last_Sold`,`LastUpdated`,`Location`,`Services`,`RWareHouse1`,`RWareHouse2`,`Summary`,`Specs`,`BackStory`,`Reward`,`Release_Date`,`RemQty`,`BarcodeNo`,`Currency`,`Expiry_Date`,`Recommended`,`Inventory_Qty`,`GroupsID`,`ItemClicks`,`ShipBy`,`Temp`,`images`,`featured`) VALUES (12278,'GG80779','Dengar~登加~','3',8,43,'208',0,1,850.00,950.00,0.00,300.00,639.98,'','',1,'SUP-US-GG','09/14/2018','US$',98.99,'6',0,0,'0','','0',0.00,0,1200.00,1200.00,200.00,'','','08/15/2018',0,'09/07/2018',0.00,'','','','','','2018-12-19 13:58:04','',0,'CN-WH','undefined','Dengar is an effective bounty hunter. While some hunters prided themselves on finesse and style, Dengar preferred firepower and destruction to capture his targets. Boba Fett enjoyed working with Dengar and held him in high regard due to his proven record of accomplishment in hunting down prey.\nIn Gentle Giant LTD’s newest Collector’s Gallery statue, we see a battle-hardened Dengar guarding a supply crate full of additional firepower with his trusty Valken-38 carbine rifle in hand.  Hossing all of that heavy firepower from one end of the quadrant to the next has taken its toll but it has been worth it to establish his reputation as one of the best hunters in the galaxy.    Dengar has seen it all and has lived to tell the tale; you can see every bounty etched into his face, every struggle to capture his prisoner scratched into his armor.  He missed the bounty for Solo, but he has gone back to his armory to reload and he will get his next mark… dead or alive.\nDengar is the sixth statue in Bounty Hunter 1:8th Collector’s Gallery line celebrating over 40 years of the Star Wars universe. Each limited edition, hand-painted piece is layered in character detail and is cast in high quality polyresin with crisp, screen accurate details. This statue also comes individually numbered with a matching Certificate of Authenticity.~~','About 10 - 12cm tall\nScale: 1/6~大约 25-30cm 高\n比例: 1/8~','~~',0,'Mar 2019',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
