 novels, books, DVDs, video games or ancient, discarded Jedi texts. Every feather, every rock and every glassy, soulful eye has been painstakingly sculpted by the artisans at Gentle Giant Ltd.  Each bookend comes with an optional bookend extender for holding taller items. Each limited-edition hand-painted bookend set comes individually numbered and is packed with a matching Certificate of Authenticity.~A Porg is a small, flat-muzzled avian that likes to flock about the rocks and roosts in cliffs of secluded areas.  In the latest set of sculptural bookends from Gentle Giant Ltd., we see two adorable, inquisitive Porgs down in the lowlands of the hidden island of Ahch-To.  They have happened upon Luke Skywalker’s recently discarded lightsaber and do not know what to make of it.   These two innocent Porgs are clueless that they are residing in an unknown region of the galaxy where the Jedi Order was founded, they just know there is something shiny there that wasn’t there before.  They have no idea they are at the crossroads with the last of the Jedi Knights…\nCrafted using only the highest quality Polystone, each Porg bookend is weighted to grip and keep your books upright and in pristine condition. The Star Wars: The Last Jedi Porg Bookends are perfect for holding comics, graphic novels, books, DVDs, video games or ancient, discarded Jedi texts. Every feather, every rock and every glassy, soulful eye has been painstakingly sculpted by the artisans at Gentle Giant Ltd.  Each bookend comes with an optional bookend extender for holding taller items. Each limited-edition hand-painted bookend set comes individually numbered and is packed with a matching Certificate of Authenticity.~','Bookend~书挡~','~~',0,'Mar 2019',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
