ction figure form!\n \nBased on Bill Skarsgård’s portrayal of the nightmare-inducing clown, this 7” scale figure has been painstakingly detailed to be as accurate to Pennywise’s ornate costume as possible.\n \nTo recreate some of the most terrifying scenes from the movie, this special edition version features bloody deco and two interchangeable heads, interchangeable hands, “I Heart Derry” red balloon and exclusive Georgie’s severed arm accessory.\n \nThis edition comes in collector-friendly deluxe window box packaging with a lenticular opening flap.\n~','7 inches tall with Articulation~7寸高 可动~','~~',0,'Oct 2018',0,'','RMB','',0,0,1,0,'1',7,NULL,0);
