 their strength, meaning when push comes to shove, Grimlock will always fall in on the right side of the fence. And despite their disagreements, Grimlock holds a respect for Prime\'s strength and leadership. His real feud within the Autobot ranks is with Prowl; Grimlock\'s chaotic behavior drives Prowl up the wall, and Prowl\'s uptight personality gives Grimlock much grief.\n\n<BR>Grimlock is the leader of the Dinobots, a small but powerful strike squad. Grimlock himself is extremely strong and durable, and is one of the few Transformers who can not only stand toe-to-toe with Optimus Prime and Megatron, but actually give them a run for their money. Despite his strength and prowess, Grimlock continually struggles with his pronouns.~Some Autobots wonder why Grimlock (aka Dinobot or Clobber) is even on their side. His disposition is much more suited to the Decepticons. After all, he values power and strength over wisdom and compassion, and furthermore, he doesn\'t really get along with most Autobots. When faced with a problem, his usual responses are to slice it with his energo-sword, tear it to pieces with his bare hands, or outright eat it. He is more willing to accept casualties than most of the Autobot leadership, and doesn\'t seem particularly concerned about the fleshies either. These things, coupled with his dislike of Optimus Prime, have led to a defection or two on Grimlock\'s part. He\'d have no problem offing the Autobot leader if he thought he could get away with it, though.\nWhat the Autobots don\'t realize is that the only thing he hates more than weakness is those who abuse their strength, meaning when push comes to shove, Grimlock will always fall in on the right side of the fence. And despite their disagreements, Grimlock holds a respect for Prime\'s strength and leadership. His real feud within the Autobot ranks is with Prowl; Grimlock\'s chaotic behavior drives Prowl up the wall, and Prowl\'s uptight personality gives Grimlock much grief.\n\n<BR>Grimlock is the leader of the Dinobots, a small but powerful strike squad. Grimlock himself is extremely strong and durable, and is one of the few Transformers who can not only stand toe-to-toe with Optimus Prime and Megatron, but actually give them a run for their money. Despite his strength and prowess, Grimlock continually struggles with his pronouns.~','<ul>\n<li>L.E.D. Lightings: Eyes</li>\n<li> Material: PU, PP, Polyresin</li>\n\n<li> </li>\n<li>In the Package </li>\n<li>1pc  - Grimlock Dino Mode </li>\n<li>4pcs -  Sharkticon</li>\n<li>1pc - Sharkticon Robot Mode</li>\n<li>1pc – Attacking Wheelie </li>\n<li>Base</li>\n\n<BR>\n<li>Measurement: 68cm (W) x 68cm (W) x 53cm(H)</li>\n<li>Weight: 23kg</li>\n<li>Scale : Non scale, refer to measurement</li>\n<li>Edition Size 150pcs </li>\n<li>Actual product Color may vary from pictures on website</li>\n<li>Note: Suitable for Ages 14 and Above  </li>\n</ul>~<ul>\n<li>L.E.D. Lightings: Eyes</li>\n<li> Material: PU, PP, Polyresin</li>\n\n<li> </li>\n<li>In the Package </li>\n<li>1pc  - Grimlock Dino Mode </li>\n<li>4pcs -  Sharkticon</li>\n<li>1pc - Sharkticon Robot Mode</li>\n<li>1pc – Attacking Wheelie </li>\n<li>Base</li>\n\n<BR>\n<li>Measurement: 68cm (W) x 68cm (W) x 53cm(H)</li>\n<li>Weight: 23kg</li>\n<li>Scale : Non scale, refer to measurement</li>\n<li>Edition Size 150pcs </li>\n<li>Actual product Color may vary from pictures on website</li>\n<li>Note: Suitable for Ages 14 and Above  </li>\n</ul>~','~~',0,'Jun 2019',0,'','RMB','',0,0,0,0,'1',7,NULL,0);
