x with opening flap.~This Ultimate Gamer Gremlin features over 25 points of articulation, including ears and jaw. \n \nHe also comes with a bucket of popcorn that can be placed over his head, sunglasses, a propeller hat, soda for late night gaming, a handheld arcade game, a classic joystick and of course his very own copy of the Gremlins video game box. \n \nAll of this packaged in a collector-friendly window box with opening flap.~','~~',0,'Mar 2019',0,'','RMB','',0,0,1,0,'1',0,NULL,0);
