One:12 Collective adjustable display post\n\nEach One:12 Collective Captain Marvel figure is packaged in a collector friendly box, designed with collectors in mind.                ~\nACCESSORIES:\nOne (1) Goose The Cat\nOne (1) bomber jacket\nTwo (2) Energy ball effects\nTwo (2) Energy wrap effects\nTwo (2) Energy beam effects\nOne (1) One:12 Collective display base with logo\nOne (1) One:12 Collective adjustable display post\n\nEach One:12 Collective Captain Marvel figure is packaged in a collector friendly box, designed with collectors in mind.                ~','~~',0,'Oct 2019',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
