 Bust or you might regret it, bub.\n~Now he’s the bust there is- Sideshow is proud to unleash the Wolverine Life-Size Bust into your Marvel collection. \n\nThis incredible member of the X-Men has been brought to life in an epic 1:1 scale, straight from the Marvel Universe to your shelf. The Wolverine Life-Size Bust stands over 27” tall, capturing the savage snarl of this mighty mutant. With his teeth bared, this bust captures the ferocity and anger of the Adamantium-infused warrior. \n\nSculpted with incredible lifelike textures and detail, the fiberglass Wolverine Life-Size Bust depicts the hero clad in his brown and yellow costume with his iconic cowl and white eyes. His muscular shoulders give Wolverine an added presence as if he could leap off the stand and start slashing with a quick SNIKT! \n\nBring home your very own Weapon X today! Claw out a space in your Marvel collection for the Wolverine Life-Size Bust or you might regret it, bub.\n~','1:1 Scale~1:1 Scale\n~','~~',0,'Dec 2018',0,'','RMB','',0,0,1,7,'2',0,NULL,0);
