aged in a collector-friendly window box, perfect for display.~MDS Roto Plush IT (2017): Pennywise\n                                                                                                                                                                                                                            From the Warner Bros. blockbuster film “IT (2017)”, Mezco presents the MDS Roto Plush Pennywise.\n\nAt approximately 18 inches tall, The MDS Roto Plush Pennywise features a menacing stare and maniacal grin. The demonic shape-shifter is outfitted in a clown costume with ruffle detailing around the collar, wrists, and ankles.\n\nPennywise, based on the novel ‘IT’ by Stephen King, is the red balloon-toting, demonic clown who terrorizes the children of Derry, Maine. Every 27 years, Pennywise awakens to feed on fear, taking the form of what his prey dreads most.\n\nThe MDS Roto Plush Pennywise comes packaged in a collector-friendly window box, perfect for display.~','~~','~~',0,'Sep 2019',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
