es about the rules and instructions they had to follow in order to survive.\n\nThe MDS Mega Scale Saw: Talking Billy is packaged in a collector-friendly window box, perfect for display.~','The MDS Mega Scale Talking Saw figure stands at a menacing 15” tall and features 11 points of articulation. Depress the button discretely hidden on his back to activate sound. ~The MDS Mega Scale Talking Saw figure stands at a menacing 15” tall and features 11 points of articulation. Depress the button discretely hidden on his back to activate sound. ~','~~',0,'Nov 2019',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
