dur, Radagast defies his friend’s wishes and returns to rescue him. But the Brown Wizard knows better than to return alone. With him comes the Head of the Order of the Istari, Saruman the White; Galadriel, Lady of Lórien; and Elrond, Lord of Rivendell. \n\nAmong the wisest and most powerful beings in Middle-earth, the gathered White Council must match strength with the dark forces gathering there, compelling the shadowy Necromancer to reveal himself sooner than he had planned.\n\nGleaming in his burnished armour and swinging his mighty sword, Hadhafang, Elrond is a vision of the great Elf Lords of ages past, revealed in wrath. No Wraith can stand against the fury of his blows as he and the Wizard Saruman meet the attacking Nazgûl in battle.~','1:6 Scale Statue~1:6 Scale Statue~','~~',0,'Aug 2019',0,'','RMB','',0,0,1,0,'0',0,NULL,0);
